import Head from 'next/head';

const DashboardHead = (props) => {
    return(
        <Head>
            <title>{props.title}</title>
            <meta charSet="utf-8" />
            <link rel="apple-touch-icon" sizes="76x76" href="/mdAssets/img/apple-icon.png" />
            <link rel="icon" type="image/png" href="/mdAssets/img/favicon.png" />
            <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
            <meta content='width=device-width, initial-scale=1.0, shrink-to-fit=no' name='viewport' />
            { /*<!--     Fonts and icons     --> */}
            <link rel="stylesheet" type="text/css" href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700|Roboto+Slab:400,700|Material+Icons" />
            <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/font-awesome/latest/css/font-awesome.min.css" />
             { /*<!-- CSS Files --> */}
            <link href="/mdAssets/css/material-dashboard.css?v=2.1.2" rel="stylesheet" />
            { /* <!-- CSS Just for demo purpose, don't include it in your project --> */}
            <link href="/mdAssets/demo/demo.css" rel="stylesheet" />
        </Head>
    )
}

export default DashboardHead;
